//////////////////////////////////////////////////////////////////////
// Purpose: Header Component
// Author: Siddharth Karanchery
//////////////////////////////////////////////////////////////////////
import React, { useState } from "react";

import "./Header.css";

function Header() {
  const [userType, setUserType] = useState();

  return (
    <div>
      <img src="https://www.graphicsprings.com/filestorage/stencils/1cf0e62090ebd950855b702c81587979.png?width=500&height=500"></img>
      <ul>
        <li>Social Media Toolbar</li>
        <li>Seller/Buyer Element</li>
      </ul>
    </div>
  );
}

export default Header;
